SET FOREIGN_KEY_CHECKS = 0;

DROP TABLE IF EXISTS  `video_info_iqiyi`;
CREATE TABLE `video_info_iqiyi` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `vid` varchar(128) NOT NULL COMMENT '视频的唯一id，每个视频来源给出唯一的',
  `title` varchar(128) NOT NULL COMMENT '视频标题',
  `thumbnail` varchar(256) DEFAULT NULL COMMENT '视频截图',
  `link` varchar(256) NOT NULL COMMENT '视频播放链接',
  `duration` int(11) NOT NULL DEFAULT '0' COMMENT '时间，秒为单位',
  `tags` varchar(128) DEFAULT '' COMMENT '视频标签，多个标签用逗号分隔',
  `view_count` int(11) DEFAULT '0' COMMENT '总播放数',
  `favorite_count` int(11) DEFAULT '0' COMMENT '总收藏数',
  `comment_count` int(11) DEFAULT '0' COMMENT '总评论数',
  `up_count` int(11) DEFAULT '0' COMMENT '总顶数',
  `down_count` int(11) DEFAULT '0' COMMENT '总踩数',
  `userid` varchar(128) DEFAULT NULL COMMENT '发布用的id，各个平台定义',
  `username` varchar(128) DEFAULT NULL COMMENT '发布用户的名称',
  `userlink` varchar(256) DEFAULT NULL COMMENT '用户的链接',
  `thumbnail_v2` varchar(256) DEFAULT NULL COMMENT '视频截图2',
  `published` datetime DEFAULT NULL COMMENT '发布时间',
  `category` varchar(256) DEFAULT NULL COMMENT '类别，视频平台定义的',
  `state` varchar(256) DEFAULT NULL COMMENT '当前视频状态',
  `operation_limit` varchar(256) DEFAULT NULL COMMENT '是否可操作',
  `streamtypes` varchar(256) DEFAULT NULL COMMENT '视频流类型',
  `fetch_time` datetime DEFAULT NULL COMMENT '抓取时间',
  `public_type` varchar(128) DEFAULT NULL COMMENT '公共类型，私有或者开放',
  `paid` varchar(128) DEFAULT NULL COMMENT '是否需要付费观看',
  `bigThumbnail_v2` varchar(256) DEFAULT NULL COMMENT '超大截图',
  `is_panorama` tinyint(4) DEFAULT NULL COMMENT '是否是全部内容',
  `bigThumbnail` varchar(256) DEFAULT NULL COMMENT '超大截图',
  `source` varchar(32) DEFAULT NULL COMMENT '来源，如youku，iqiyi',
  `appbk_category` varchar(32) DEFAULT NULL COMMENT 'appbk内部对应的类别',
  `down_action_time` datetime DEFAULT NULL COMMENT '下载时间(是否已经下载)',
  PRIMARY KEY (`id`),
  UNIQUE KEY `source_vid` (`vid`,`source`) USING BTREE,
  KEY `title` (`title`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=18425 DEFAULT CHARSET=utf8;

SET FOREIGN_KEY_CHECKS = 1;

